import React from 'react';
import './styles/Header.css';

function Header() {
  return (
    <header className="header">
      <h1>Unacademy PLP</h1>
      <nav>
        <a href="/">Home</a>
        <a href="/products">Products</a>
        <a href="#auth">Sign In</a>
      </nav>
    </header>
  );
}

export default Header;
